import * as React from 'react';
import { Chart } from 'react-google-charts';
import './Userhome.css'

export const data = [
    ["Task", "Hours per Day"],
    ["Utilities", 200],
    ["Entertainment", 200],
    ["Food", 400],
    ["Transportation", 250],
    ["Miscellaneous", 350],
    ["Rent", 800]
  ];

  export const options = {
    title: "Expenses",
    titleTextStyle: {
        fontSize: 25,
        bold: true
    },
    is3D: true,
    'chartArea': {'width': '100%', 'height': '80%'},
  };

const Userhome = () => {
    return (
        <div className='userhome-global'>
            <div>
                User Profile
            </div>
            <div className='userhome-profile'>
                <div>
                    <img src="" alt="prof pic goes here" />
                </div>
                <div>Username
                </div>
            </div>
            <Chart className='piechart'
                chartType='PieChart'
                data={data}
                options={options}
                width={"800px"}
                height={"500px"}
            />
        </div>
    )
}

export default Userhome;
